import React from "react";

// type Props = { items: string[]; children: any };

const Todos: React.FC<{ items: string[] }> = (props) => {
  return (
    <ul>
      {props.children}
      {props.items.map((li) => {
        {
          <li>{li}</li>;
        }
      })}
    </ul>
  );
};

export default Todos;
